import { SwipeCell } from 'vant';

export default {
  name: 'SwipeCell',
  components: {
    [SwipeCell.name]: SwipeCell
  },
  props: {
    leftWidth: {
      type: Number,
      default: 0
    },
    rightWidth: {
      type: Number,
      default: 0
    },
    disabled: {
      type: Boolean,
      default: false
    },
    onClose: Function
  },
  methods: {
    open (position) {
      if (position && typeof position === 'string') {
        this.$refs.swipecell.open(position);
      }
    },
    close () {
      this.$refs.swipecell.close();
    },
    onClick (position) {
      this.$emit('click', position);
    }
  }
};
